tion:"Exit your staking position.",extensionConnected:"Extension Connected",extensions:"Extensions",fastUnstakeCurrentQueue:"Number of accounts currently in the fast unstake queue",fastUnstakeExposedAgo_one:"You were last exposed {{count}} Era Ago",fastUnstakeExposedAgo_other:"You were last exposed {{count}} Eras Ago",fastUnstakeNote1:"To register for fast unstake, you must not be actively staking for more than {{bondDuration}} eras.",fastUnstakeNote2_one:"If you are inactive for at least {{count}} more Era, you will be able to register for fast unstake.",fastUnstakeNote2_other:"If you are inactive for at least {{count}} more Eras, you will be able to register for fast unstake.",fastUnstakeOnceRegistered:"Once registerd you will be waiting in the fast unstake queue.",fastUnstakeRegistered:"Registered and Waiting to Unstake",fastUnstakeSubmit_cancel:"Cancel Fast Unstake",fastUnstakeSubmit_register:"Register",fastUnstakeUnorderedNote:"The fast unstake queue is unordered, so the exact timing of being selected is not known.",fastUnstakeWarningUnlocksActiveMore:"No unlocks can be active to register for fast unstake. Rebond or withdraw your unlocks to become fully bonded and try registering for fast unstake again.",fastUnstakeWarningUnlocksActive_one:"You have {{count}} unlock active.",fastUnstakeWarningUnlocksActive_other:"You have {{count}} unlocks active.",fastUnstake_register:"Register Fast Unstake",fastUnstake_title:"Fast Unstake",favoriteNotNominated:"Favorite Validators / Not Nominated",favoriteValidators:"Favorite Validators",favoritesAddedSubtitle_one:"{{count}} validator has been added to your nominees",favoritesAddedSubtitle_other:"{{count}} validators have been added to your nominees",favoritesAddedTitle_one:"Favorite Added",favoritesAddedTitle_other:"Favorites Added",feedback:"Feedback",feedbackPage:"We host a feedback page on",for:"For {{who}}",forget:"Forget",free:"Free",getAnotherAccount:"Get Another Account",gettingAccount:"Getting Account",gettingAddress